import React from "react";

import { HeaderStyle } from "../../2_styles/1_layout/HeaderStyle";
import bgImg from "../../3_images/2_theInitiative/bg_initiative-banner.jpg";

export default function Header({ title, subtitle }) {
  return (
    <div>
      <HeaderStyle bgImg={bgImg}>
        <div className="bgImg_shadow"></div>
        <div className="bgImg"></div>

        <div className="title">
          <p>the</p>
          <p>{title}</p>
          <div className="line"></div>
          <p>{subtitle}</p>
        </div>
      </HeaderStyle>
    </div>
  );
}
